<section class="gs-partner-promote-section content-section-container">
    <div class="gs-partner-what-promote-container">
        <h2 class="gs-partner-what-promote-title">
            What Can you Promote?
        </h2>
        <div class="gs-partner-what-promote-text">
            We offer our partners the flexibility of promoting single programs for a yearly fee, a whole departments, or their entire university program.
        </div>
    </div>
    <div class="gs-partner-what-promote-boxes-conatiner">
        <div class="gs-partner-what-promote-box-program gs-promote-box" data-promote-box="1">
            <div class="gs-promote-box-content">
                <div class="gs-promote-svg-1">
                    <svg width="38" height="38" viewBox="0 0 38 38" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                        <rect width="38" height="38" fill="url(#pattern_graduation)"/>
                        <defs>
                        <pattern id="pattern_graduation" patternContentUnits="objectBoundingBox" width="1" height="1">
                        <use xlink:href="#image0_0_177" transform="scale(0.00195312)"/>
                        </pattern>
                        <image id="image0_0_177" width="512" height="512" xlink:href="data:image/png;base64,"/>
                        </defs>
                    </svg>
                </div>
                <h3 class="gs-promote-box-title">Promote your university programme</h3>
                <p class="gs-promote-box-text">You can showcase all your programs to a global audience of international students</p>
            </div>
        </div>
        <div class="gs-partner-what-promote-box-course gs-promote-box" data-promote-box="2">
            <div class="gs-promote-box-content">
                <div class="gs-promote-svg-2">
                    <svg width="40" height="40" viewBox="0 0 40 40" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                        <rect width="40" height="40" fill="url(#pattern_program)"/>
                        <defs>
                        <pattern id="pattern_program" patternContentUnits="objectBoundingBox" width="1" height="1">
                        <use xlink:href="#image0_0_163" transform="scale(0.00195312)"/>
                        </pattern>
                        <image id="image0_0_163" width="512" height="512" xlink:href="data:image/png;base64,"/>
                        </defs>
                    </svg>
                </div>
                <h3 class="gs-promote-box-title">Promote a single course</h3>
                <p class="gs-promote-box-text">We offer the flexibility to promote a single program, giving it the traction it deserves among students seeking niche educational paths</p>
            </div>
        </div>
        <div class="gs-partner-what-promote-box-department gs-promote-box" data-promote-box="3">
            <div class="gs-promote-box-content">
                <div class="gs-promote-svg-3">
                    <svg width="43" height="43" viewBox="0 0 43 43" fill="none" xmlns="http://www.w3.org/2000/svg" xmlns:xlink="http://www.w3.org/1999/xlink">
                        <rect width="43" height="43" fill="url(#pattern_departmet)"/>
                        <defs>
                        <pattern id="pattern_departmet" patternContentUnits="objectBoundingBox" width="1" height="1">
                        <use xlink:href="#image0_23_14" transform="scale(0.00195312)"/>
                        </pattern>
                        <image id="image0_23_14" width="512" height="512" xlink:href="data:image/png;base64,"/>
                        </defs>
                    </svg>
                </div>
                <h3 class="gs-promote-box-title">Promote an entire departement</h3>
                <p class="gs-promote-box-text">You can also promote  an entire department, highlighting the breadth and depth of academic prospects available within that discipline</p>
            </div>
        </div>
    </div>
</section>